import React, { useState, useEffect } from "react";
import { Card, ListGroup, Button } from "react-bootstrap";

function PortfolioComponent() {
  const [noStocks, setNoStocks] = useState(true);
  const [portfolioStocks, setPortfolioStocks] = useState([]);

  useEffect(() => {
    const existingPortfolio = localStorage.getItem("portfolio");
    console.log("Existing Portfolio: " + existingPortfolio);

    if (existingPortfolio) {
      const portfolio = JSON.parse(existingPortfolio);

      if (portfolio.length === 0) {
        setNoStocks(true);
      } else {
        setNoStocks(false);

        portfolio.forEach((stock) => {
            Promise.all([
                fetch(`http://localhost:8080/ticker/${stock.symbol}`).then((response) => response.json()),
                fetch(`http://localhost:8080/iex/${stock.symbol}`).then((response) => response.json()),
            ])
                .then(([tickerData, iexData]) => {
                console.log("Ticker Data: ", tickerData);
                console.log("IEX Data: ", iexData);

                const updatedStock = { ...stock, tickerData, iexData };
                return updatedStock;
                })
                .then((updatedStock) => {
                console.log("Updated Stock: ", updatedStock);
                setPortfolioStocks(updatedStock);
                })
                .catch((error) => {
                console.log("Error fetching portfolio stocks:", error);
                });
            });
      }
    }
  }, []);

  return (
    <div>
      <h2>Portfolio</h2>

      {noStocks && (
        <div>
          <Card
            style={{
              marginRight: "20px",
              marginLeft: "20px",
              marginTop: "10px",
              maxWidth: "70%",
            }}
          >
            <Card.Body>No stocks in watchlist</Card.Body>
          </Card>
        </div>
      )}

      {!noStocks && (
        <ListGroup>
          {
          Array.isArray(portfolioStocks) &&

          portfolioStocks.map((stock) => (
          <ListGroup.Item
              key={stock.id}
            style={{ border: "none", alignItems: "center" }}
          >
            <Card
              style={{
                marginRight: "20px",
                marginLeft: "20px",
                marginTop: "10px",
                maxWidth: "70%",
              }}
            >
              <Card.Header>
                <Card.Title>Stock Name</Card.Title>
              </Card.Header>
              <Card.Body>
                <div className="container">
                  <div className="row">
                    <div className="col">
                      <div className="row">
                        <div className="col left-align">
                          <div className="text-start">
                            Quantity: 
                          </div>
                        </div>
                        <div className="col right-align">
                          <div className="text-end">
                            $val
                          </div>
                        </div>
                      </div>
                      <div className="row">
                        <div className="col left-align">
                          <div className="text-start">
                            Avg. Cost/Share: 
                          </div>
                        </div>
                        <div className="col right-align">
                          <div className="text-end">
                            $val
                          </div>
                        </div>
                      </div>
                      <div className="row">
                      <div className="col left-align">
                          <div className="text-start">
                            Total Cost: 
                          </div>
                        </div>
                        <div className="col right-align">
                          <div className="text-end">
                            $val
                          </div>
                        </div>
                      </div>
                    </div>
                    <div className="col">
                      <div className="row">
                      <div className="col left-align">
                          <div className="text-start">
                            Change: 
                          </div>
                        </div>
                        <div className="col right-align">
                          <div className="text-end">
                            $val
                          </div>
                        </div>
                      </div>
                      <div className="row">
                      <div className="col left-align">
                          <div className="text-start">
                            Current Price: 
                          </div>
                        </div>
                        <div className="col right-align">
                          <div className="text-end">
                            $val
                          </div>
                        </div>
                      </div>
                      <div className="row">
                      <div className="col left-align">
                          <div className="text-start">
                            Market Value:
                          </div>
                        </div>
                        <div className="col right-align">
                          <div className="text-end">
                            $val
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </Card.Body>
              <Card.Footer className="d-flex justify-content-end">
                <Button
                  variant="primary"
                  // onClick={() => handleCardClick(stock.symbol)}
                  style={{ marginRight: "10px" }}
                >
                  Buy
                </Button>
                <Button
                  variant="danger"
                  // onClick={() => handleDelete(stock.symbol)}
                >
                  Sell
                </Button>
              </Card.Footer>
            </Card>
          </ListGroup.Item>
          ))}
        </ListGroup>
      )}
    </div>
  );
}

export default PortfolioComponent;
